exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper}=await require("transcode/parse_catalog"),url=`http://www.vbiquge.co/${bid.idPrefix()}_${bid}/`;return parseCatalog(url,{cleaner:html=>cleanCatalogWrapper(html,/id="list-chapterAll"[^>]*>/,"</div>"),recordRegex:/href="(?<url>[^"]+)"[^>]*>(?<name>[^<]+)</g},{clientOptions:{...(options&&options.clientOptions)}})};